import React from "react";
import picture from "../images/me 1.jpeg";

export default function Start() {
  return (
    <div className="h-screen bg-black text-white">
      <div className="flex flex-col items-center justify-center space-y-8 pt-8">
        <h1 className="text-4xl">Hi, I'm Wajahat!</h1>
        <p className="">
          I develop websites using modern technology. My stack is{" "}
          <span className="uppercase">mern</span>
        </p>
        <img className="w-96" src={picture} alt="img" />
      </div>
    </div>
  );
}
